import React from 'react';
import OnClick from './OnClick';
import OnSubmit from './OnSubmit';
import OnChange from './OnChange';
import './App.css';


function App() {
  return (
    <div>
      <OnClick />
      <OnSubmit />
      <OnChange />
    </div>
  );
}

export default App;
